import './App.css';
import Create from './components/Create';
import Login from './components/Login';
import {Routes , Route } from "react-router-dom" 
import { Link } from 'react-router-dom';  

function App() {
  return (
    <div className="App">
    <div className="main">
    </div>
     <Create />
     <Link path="/login" component={<Login/> } /> 
    </div>
  );
}

export default App;
